import { FadeProps } from "fade-props";
import { useState } from "react";
import ButtonsSelector from "../../utils/components/ButtonsSelector";

function Home() {

	const [selected, setSelected] = useState(0);

	const Ab = () => {
		return <button>LOL</button> 
	}

	return (
		<>
			<ButtonsSelector buttons={["Section 1", "Section 2"]} selected={selected} setSelected={setSelected} />
			<FadeProps>
				{selected === 0 && <Ab />}
				{selected === 1 && <Ab />}
			</FadeProps>
		</>
	);
}

export default Home;
